import React from "react";
import PropTypes from "prop-types";
import "./side.css";

Side.prototype = {};

function Side(props) {
  return (
    <div className="sideBar">
      <ul>
        <li>All Task</li>
        <li>New Task</li>
        <li>Doing Task</li>
        <li>Done Task</li>
      </ul>
    </div>
  );
}

export default Side;
